import React from 'react';
import { Container, Typography, Box } from '@mui/material';

const Jobs: React.FC = () => {
  return (
    <Container maxWidth="lg">
      <Box sx={{ py: 3 }}>
        <Typography variant="h4" gutterBottom>
          Jobs
        </Typography>
        <Typography>
          Job management interface will be displayed here.
        </Typography>
      </Box>
    </Container>
  );
};

export default Jobs;
